@xpnetwork_ @ethereum @0xPolygon @BNBCHAIN @trondao @tezos @ElrondNetwork @Algorand @rsquadeu TON Bridge update

As you’re already aware, two crosschain bridges with the Ethereum and BNB Chain networks have been operating for over a year, allowing users to transfer their #Toncoin among the three blockchains.

They’ll become even more convenient with the upcoming update!

@xpnetwork_ @ethereum @0xPolygon @BNBCHAIN @trondao @tezos @ElrondNetwork @Algorand @rsquadeu 🌈  bridge with #EVM-compatible blockchains

Crosschain bridges are managed by decentralized oracles acting as an intermediary.

The TON Foundation intends to develop these bridges to make them solely rely on smart contracts and thus eliminate the dependency on intermediaries.

@xpnetwork_ @ethereum @0xPolygon @BNBCHAIN @trondao @tezos @ElrondNetwork @Algorand Support for Ethereum- and BNB Chain-based cryptocurrencies on TON.

The @rsquadeu team is creating a bridge letting users send tokens from Ethereum and BNB Chain to TON and vice versa. 

TON users will be able to store any token based on the two blockchains in TON crypto wallets.

